                            {
                                VisionStateMachine = (VisionStateMachineState)replacement;
                            }
                        }
                    }

                    instance = VisionStateMachine;
                    break;
                }
            }

            if (instance != null)
            {
                return instance;
            }

            return base.FindChild(context, browseName, createOrReplace, replacement);
